import React, { useEffect, useState } from "react";
import { useDispatch } from "react-redux";
import { Link } from "react-router-dom";
import { Button, Container, Segment } from "semantic-ui-react";
import { useHistory } from "react-router-dom";
import { logout } from "./../_actions/auth.js";

export default function Landing() {
  var [user, setUser] = useState(localStorage.getItem("userData"));
  useEffect(() => {
    setUser(localStorage.getItem("userData"));
  }, []);
  const history = useHistory();
  const dispatch = useDispatch();
console.log(user);
  if (user) {
    console.log(user);
    return (
      <div>

        <Container>
          <Segment basic padded="very">
            {/* <h3>Welcome back to TweTwe{JSON.parse(user).result.name}</h3> */}
          </Segment>
          <Button primary basic>
            <Link to={{
                  pathname: "/home",
                  state:{
                    id:JSON.parse(user).result._id,
                    token:JSON.parse(user).token
                  },

                  }}>

              Home


            </Link>
          </Button>
          <Button
            primary
            basic
            onClick={(e) => {
              dispatch(logout(JSON.parse(user).token));
              history.push('/')
              // localStorage.setItem("userData", "");
              // userData = "";
              // history.push("/home");
            }}
          >
            Logout
          </Button>
        </Container>
      </div>
    );
  } else {
    return (
      <div>
        <h1>HELLLOO</h1>
        <Segment basic padded="very">
          <h3>Welcome to TweTwe!</h3>
        </Segment>
        <Button primary basic>
          <Link to="login">Login</Link>
        </Button>
        <Button primary basic>
          <Link to="/signup">Signup</Link>
        </Button>
      </div>
    );
  // }
}
}
